import React, { Component } from 'react';

import PokemonItemOfList from './PokemonItemOfList';

export default class Team extends Component {
    render() {
        const pokemon = this.props.selectedPokemons.map((pokemon, index) => {
            if(pokemon === null) {
                return (
                    <PokemonItemOfList name="- - - -" index={index} />
                )
            }

            return (
                <PokemonItemOfList name={pokemon.name} index={index} image={pokemon.image} />
            )

        });

        return(
            <div className="pure-g team-container">
                {pokemon}
            </div>
        )
    }
}
